css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("thepiratebay.org") {

/*--------------------------------------------------
	ThePirateBay layer Stylesheet
	version:   1.2
	modified:  15/Apr/09
	author:    [shirazi]
	email:     [nitevish@gmail.com]
----------------------------------------------------
	 _____ _____ _____ _____ _____ _____ _____ 
	|   __|  |  |     | __  |  _  |__   |     |
	|__   |     |-   -|    -|     |   __|-   -|
	|_____|__|__|_____|__|__|__|__|_____|_____|

----------------------------------------------------
*/

html{
   background:url(data:image/gif;base64,R0lGODlhFAAUAIAAACQkJB0dHSwAAAAAFAAUAAACKoyPoMvowSJ4RjZarcJ6Y9hx4ddNVPmBmriSIxulqCvJ72nZLXzxMR0pAAA7) left top repeat !important;
}
body{
   background-color:#191B21 !important;
   margin:0 40px -10px 40px!important;
   padding:10px 12px 10px 12px !important;
   border-left:3px #FE8000 solid !important;
   border-right:3px #FE8000 solid !important;
   color:#C1C1C7 !important;

}
div.searchfield{
   background-color:#363940 !important;
   color:#C1C1C7 !important;
   border-left:1px solid #5F6168 !important;
   border-top:1px solid #5F6168 !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   padding-bottom:10px !important;
  -moz-border-radius: 10px 10px 0 0 !important;
  -moz-appearance: none !important
}
div.searchfield h1 a{
   display:block !important;
   width:246px !important;
   height:258px !important;
   background:transparent url(data:image/gif;base64,) left top no-repeat !important;
}
h3{
   background:#44474F url(data:image/gif;base64,R0lGODlhBAAeAKIAABgZHP6AATw/RycpMB0fJQAAAAAAAAAAACH5BAAAAAAALAAAAAAEAB4AAAMdGBoDTQIOMqGkxIpZ48Yal3liCJLn1akja64fLCYAOw==)left top repeat-x !important;
   line-height:26px !important;
   border-bottom:1px #181B16 solid !important;
   margin:0 !important;
}
h3 a{
   color:#C1C1C7 !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:13px !important;
}
a{
   color:#C1C1C7 !important;
   border-color:#fe8000 !important;
}
a:hover{
   color:#FE8000 !important;
   border-style:none !important;
}
.ads,.ad,.spons-link,
.bannerBorder table,
.noborder iframe,
div#topright,
#main-content iframe,
iframe, div#fbanners,
img[alt*="Toolbar"],
body > a > img,
img[src*="adimage.php?"],
body > br
{
   display:none !important;
}
div#content{
   margin-top:5px !important;
}
#main-content{
   margin:0 !important;
}
div.searchfield form tbody tr[style*="margin: 0pt auto;"] td{
   text-align:left !important;
}
div.searchfield form tbody tr td input[type*="text"]{
   width:420px !important;
}
table#searchResult{
   border-collapse:separate !important;
   border-spacing:0 !important;
}
#main-content table tbody tr{
   background-color:#44474F !important;
}
#main-content table tbody tr.alt{
   background-color:#363940 !important;
}
table#searchResult tr:hover, #main-content table tbody tr.alt:hover {
   background:#44474F url(data:image/gif;base64,R0lGODlhBAAeAKIAABgZHP6AATw/RycpMB0fJQAAAAAAAAAAACH5BAAAAAAALAAAAAAEAB4AAAMdGBoDTQIOMqGkxIpZ48Yal3liCJLn1akja64fLCYAOw==)left top repeat-x !important;
}
table#searchResult tr td a img[alt*="Download"]{
   display:none !important;
}
a img[src*="http://static.thepiratebay.org/img/next.gif"]{
   width:0px !important;
   padding:11px 7px 0 0!important;
   background:transparent url(data:image/gif;base64,R0lGODlhBwALAJEAAAAAAP9gCf///wAAACH5BAEAAAIALAAAAAAHAAsAAAIUFIQIcbnsgmxvGolBhZVaBSWGKBQAOw==) left top no-repeat!important;
}
a img[src*="http://static.thepiratebay.org/img/prev.gif"]{
   width:0px !important;
   padding:11px 7px 0 0!important;
   background:transparent url(data:image/gif;base64,R0lGODlhBwALAJEAAAAAAP9gCf///wAAACH5BAEAAAIALAAAAAAHAAsAAAISlA2Hkcv+QJhM0nibfa4tjwgFADs=) left top no-repeat!important;
}
table#searchResult tr td a[title*="Download this torrent"]{
   display:block !important;
   width:11px !important;
   height:9px !important;
   margin-left:5px !important;
   background-image:url(data:image/gif;base64,R0lGODlhCwAJAJEAAAAAAP9gCf///wAAACH5BAEAAAIALAAAAAALAAkAAAIXFIIZIH3KHHhrmnQo07hd6DldKEakQxYAOw==) !important;
}
#main-content table tbody tr td{
   border:1px #000 solid !important;
   border-left:1px solid #5F6168 !important;
   border-top:1px solid #5F6168 !important;
   color:#C1C1C7 !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:11px !important;
}
#main-content table tbody tr td a{
   color:#C1C1C7 !important;
}
#main-content table tbody tr td a:hover{
   color:#FE8000 !important;
   text-decoration:none !important;
}
thead#tableHead th {
   background:#CCC url(data:image/gif;base64,R0lGODlhBQAbALMAAD9BSiwuNCkrMTI0PDM2PjM1PS0wOjEzOy4wNzAyOi4wOC0vNi8xOTQ3PwAAAAAAACH5BAAAAAAALAAAAAAFABsAAAQy0EkJah0Yp72Z90oYIiS5nGiqlqToip/HbUddFzje7HzvE0CgrRZjBI5HgVJpaDYnkggAOw==)left top repeat-x !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:12px !important;
   font-size-adjust:none !important;
   font-stretch:normal !important;
   font-style:normal !important;
   font-variant:normal !important;
   font-weight:bold !important;
   line-height:21px !important;
   border-color:#181B16 !important;
   border-left-style:none !important;
}
thead#tableHead th a{
   color:#C1C1C7 !important;
}
div#header{
   overflow:hidden !important;
   height:88px !important;
   padding-top:5px !important;
   background-color:#363940 !important;
   color:#C1C1C7 !important;
   border-left:1px solid #5F6168 !important;
   border-top:1px solid #5F6168 !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
  -moz-border-radius: 6px 6px 0 0 !important;
  -moz-appearance: none !important
}
div#header a.img img,
div#header+h2+br+div[align*='center']{
   display:none !important;
}
div#header a.img{
   background-image:url(data:image/gif;base64,) !important;
   display:block!important;
   width:82px !important;
   height:87px !important;
   float:left !important;
   margin-right:3px !important;
}
div#header a{
   color:#B5B5B6 !important;
   border-bottom-color:transparent !important;
}
div#header a:hover{
   color:#FF9900 !important;
}
input[type*="text"]{
   width:315px !important;
}
input[type*="checkbox"]{
  color:#C1C1C7 !important;
}
h2{
   background-image:url(data:image/gif;base64,) !important;
   border:1px #000 solid !important;
   border-top:1px solid #FE8000 !important;
   border-bottom:1px solid #FE8000 !important;
   color:#FFF !important;
   font-weight:normal !important;
   font-size:8px !important;
   line-height:24px !important;
   margin-top:0 !important;
}
div#foot{
   background-color:#000 !important;
   padding:1px 0 !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:11px !important;
   margin-top:0 !important;
  -moz-border-radius: 0 0 10px 10px !important;
  -moz-appearance: none !important
}

/* Browse Torrents' page */
td.categoriesContainer dl dt a{
   padding:5px 0 5px 34px !important;
   margin-left:-30px !important;
   border-style:none !important;
}
td.categoriesContainer dl dt a[title*="Audio"]{
   background:transparent url(data:image/png;base64,) left top no-repeat !important; 
}
td.categoriesContainer dl dt a[title*="Video"]{
   background:transparent url(data:image/png;base64,) left top no-repeat !important; 
}
td.categoriesContainer dl dt a[title*="Applications"]{
   background:transparent url(data:image/png;base64,) left top no-repeat !important; 
}
td.categoriesContainer dl dt a[title*="Games"]{
   background:transparent url(data:image/png;base64,) left top no-repeat !important; 
}
td.categoriesContainer dl dt a[title*="Other"]{
   background:transparent url(data:image/png;base64,) left top no-repeat !important; 
}
a.detLink[title*="Details for"]{
   background:transparent url(data:image/gif;base64,R0lGODlhCgALALMAAMvZwMPTtouqcrDFn6e+lLrMq564iZWxfgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAAAkALAAAAAAKAAsAAAQoMMlJE7qYIsDBnUggBplVnCgiIUPrqhYhzzBi3Hh97Hwt/MAaZpiIAAA7) left center no-repeat !important;
   padding:0 0 0 14px !important;
}
a.detLink:hover[title*="Details for"]{
   background:transparent url(data:image/gif;base64,R0lGODlhBgAJAIABALm5vf///yH5BAEAAAEALAAAAAAGAAkAAAINhIMGGMrs0pFqUThDAQA7) 2px center no-repeat !important;
}
td.vertTh a[title*="More from this category"]{
   background:transparent url(data:image/gif;base64,R0lGODlhCgAKAKIAAGZmZv/MALCwsP///93d3QAAAAAAAAAAACH5BAUUAAEALAAAAAAKAAoAAAMdGLrcAG2BAdW7hAZAus+PIIqdAF0PYUbAylZRkwAAOw==) 2px center no-repeat !important;
   padding:0 0 0 16px !important;
}

/* Torrent deail's page */

div#detailsouterframe{
   width:100% !important;
}
div#detailsframe div#title{
   background-image:url(data:image/gif;base64,) !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:14px !important;
   letter-spacing:normal !important;
   border-style:none !important;
   color:#000 !important;
}
div#detailsframe div#details{
   color:#C1C1C7 !important;
   background-color:#363940 !important;
}
div#detailsframe div#details dl.col1, div#detailsframe div#details dl.col2{
   width:48% !important;
   margin-right:2% !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:11px !important;
}
div#detailsframe div#details dl.col1 dd,
div#detailsframe div#details dl.col1 dt,
div#detailsframe div#details dl.col2 dd,
div#detailsframe div#details dl.col2 dt
{
   border-bottom:1px #1F1F1F solid !important;
}
div#detailsframe div#details dt{
   color:#FE8000 !important;
}
div#detailsframe div#details div.nfo{
   width:97.5% !important;
   padding:0 0 0 8px !important;
   color:#FFF !important;
   background-color:#000 !important;
   border:1px #000 solid !important;
   border-top:1px solid #FE8000 !important;
   border-bottom:1px solid #FE8000 !important;
}
div#commentsheader{
   background:#44474F url(data:image/gif;base64,R0lGODlhBAAeAKIAABgZHP6AATw/RycpMB0fJQAAAAAAAAAAACH5BAAAAAAALAAAAAAEAB4AAAMdGBoDTQIOMqGkxIpZ48Yal3liCJLn1akja64fLCYAOw==)left top repeat-x !important;
   line-height:26px !important;
   border-bottom:1px #181B16 solid !important;
   padding-left:10px !important;
   width:97.5% !important;
}
div#commentsheader h4{
   color:#C1C1C7 !important;
   font-family:arial,verdana,geneva,lucida,'lucida grande',helvetica,sans-serif !important;
   font-size:13px !important;
}
div#comments div p.byline{
   background-color:#000 !important;
   border-width:1px 1px 0 4px !important;
   border-color:#FE8000 !important;
   border-style:dotted dotted dotted solid !important;
   padding:5px !important;
   margin:15px 0 0 0 !important;
   width:97.0% !important;
}
div#comments div div.comment{
   background-color:#44474F !important;
   border-width:0 1px 1px 4px !important;
   border-color:#FE8000 !important;
   border-style:dotted dotted dotted solid !important;
   padding:5px !important;
   margin:0 !important;
   width:97.0% !important;
}
.download a{
   border-style:none !important;
   background:transparent url(data:image/png;base64,) left top no-repeat !important;
   padding:2px 0 2px 20px !important;
}
}
